window.bookSummaryJSON = "<p><b>Earth is a frozen wasteland...the victim of a war we hadn't realized we were fighting. </b></p> <p>Opportunities there are few and far between...that is, unless you're willing to put on a uniform. For ace-pilot Deborah Allen Riker (aka “Admiral Dare”), life had never been easy. She's defended Earth against countless enemies, both alien and human alike.</p> <p>Now she's retired. Committed to a life of solitude and studying the aliens she spent a lifetime fighting...until she finds herself dragged into a new conflict. A conflict she never saw coming.</p> <p>One of the great Arks built to carry the last vestiges of humanity into the deepest reaches of space goes missing. And she's just the gal to find it.</p> <p><b>Don't miss the start of a military sci-fi series from Amazon best seller Andrew Beery. It's perfect for fans of Rick Partlow, Christopher G. Nuttall, and Mark Wayne McGinnis.</b></p>"; 
